import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class AlgorithmService {

  constructor() { }

  nodes = [];

  testFunction(node) {
    this.nodes.push(node);
    console.log(this.nodes);
  }
}
